&lt;p&gt;Tiempo de entrega 12 d&iacute;as producto importado&lt;/p&gt;
&lt;p&gt;Aun volando cometas? Prolonga la diversi&oacute;n y el placer, Deja volar tus sue&ntilde;os con la nueva versi&oacute;n mejorada del Syma X5HW,&lt;/p&gt;
&lt;p&gt;El regalo perfecto&nbsp; para ti o tus hijos.&lt;/p&gt;
&lt;p&gt;Este cuadricoptero&nbsp; puede volar tanto en interiores y exteriores. Incluyendo 4 canales&nbsp; y un sistema de estabilizaci&oacute;n de vuelo&nbsp; que le permite una mayor maniobrabilidad.&lt;/p&gt;
&lt;p&gt;Cuenta con una bater&iacute;a recargable de alto rendimiento, intercambiable para una mayor autonom&iacute;a&nbsp; de vuelo y diversi&oacute;n.&lt;/p&gt;
&lt;p&gt;Realiza tus videos de una manera diferente y divertida, con una perspectiva diferente y profesional.&lt;/p&gt;
&lt;p&gt;&nbsp;Haga captura de&nbsp; im&aacute;genes o videos de sus actividades y eventos con el nuevo drone Syma X5HW sin duda el mejor drone de bajo presupuesto.&lt;/p&gt;
&lt;p&gt;&nbsp;Esta versi&oacute;n est&aacute; equipada con un c&aacute;mara de 0.3 MP y transmisi&oacute;n de im&aacute;genes y videos via WI-FI directamente a tu celular o Tablet, es compatible con sistemas Android y iOS, as&iacute; como giros de 360 grados entre otra gran cantidad de funcionalidades.&lt;/p&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;
&lt;p&gt;Caracter&iacute;sticas&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Marca: SYMA&lt;/li&gt;
&lt;li&gt;Referencia: X5HW&lt;/li&gt;
&lt;li&gt;Tipo de art&iacute;culo: Drone RC Quadcopter&lt;/li&gt;
&lt;li&gt;Color: azul / blanco opcional&lt;/li&gt;
&lt;li&gt;Control remoto: 2,4 / 4 Canales / modo 2&lt;/li&gt;
&lt;li&gt;Giroscopio: Seis eje&lt;/li&gt;
&lt;li&gt;Motor: motor sin n&uacute;cleo&lt;/li&gt;
&lt;li&gt;C&aacute;mara: 0.3MP c&aacute;mara&lt;/li&gt;
&lt;li&gt;de transmisi&oacute;n FPV : Wifi en tiempo real&lt;/li&gt;
&lt;li&gt;Funci&oacute;n: 360 &deg; Eversion, modo de CF, arriba, abajo, izquierdo, derecho, adelante, hacia atr&aacute;s, flotando&lt;/li&gt;
&lt;li&gt;Distancia alejada: sobre 50-100m (dependiendo Condiciones )&lt;/li&gt;
&lt;li&gt;Bater&iacute;a para el quadcopter: 3.7V 500mAh li-po&lt;/li&gt;
&lt;li&gt;Tiempo de carga: Tiempo de 60 - 100 Minutos&lt;/li&gt;
&lt;li&gt;Tiempo en Vuelo: 5-7 minutos&lt;/li&gt;
&lt;li&gt;Bater&iacute;a del mando a distancia: bater&iacute;a de 4 * AA (no incluida)&lt;/li&gt;
&lt;li&gt;Dimensiones de la bater&iacute;a de Quadcopter:&lt;/li&gt;
&lt;li&gt;43 * 25 * 8mm Dimensiones del art&iacute;culo: 330 * 330 * 110m&lt;/li&gt;
